import React, { useEffect, useState } from "react";
import "./App.css";

function App() {
  const listItems = ["Apple", "Banana", "Pineapple", "Orange"];
  const [filterList, setFilterList] = useState(listItems);
  function Search() {
    useEffect(() => {
      const input = document.getElementById("input");
      const array = document.getElementById("array");
    }, []);
  }
  return (
    <body className="App-body">
      <div>
        Search: <input type="text" id="input" onChange={Search}></input>
      </div>
      <div id="array"></div>
    </body>
  );
}

export default App;
